import React from 'react'
import Todo from './Todo'

export default function Todos(todos) {


  return (
    <div className="todo-container">
        <ul className="todo-list">
            {
                todos.map((todo, index) => {
                    return <Todo key={index} todo={todo} />
                }
                )
            }
        </ul>
    </div>
  )
}
